        { "name": "cc", "id": "2" },
        { "name": "cc", "id": "2" },
        { "name": "cc", "id": "2" }];
    Array.from(info).map(entry => {
        console.log(typeof entry)
    })

    return (
        <div className="grid grid-cols-9 gap-5">
            {Array.from(info).map((key,entry) => {
                return <div className="max-w-48  bg-white rounded shadow-lg grid grid-cols-2">
                    <div className="clo-span-1">
                        <table>
                            <tbody>
                                <tr><td>Name: </td>
                                    <td>{entry.name}</td></tr>
                                <tr><td>ID: </td><td>{entry.id}</td></tr>
                            </tbody>
                        </table>
                    </div>
                    <div className="clo-span-1">
                        <img src={persontest}></img>
                    </div>
                </div>

            })}

        </div>
    );
}
export default Personalinfo;
